import React from 'react';

function SideNav(props){
    return(
        <div>
            <div>
                <a href ="/item" className="btn"><i class="fas fa-plus m-1"></i><i class="fas fa-image"></i></a>
                <a href ="/item" className="btn"><i class="fas fa-pen m-1"></i><i class="fas fa-image"></i></a>
                <a href ="/item" className="btn"><i class="fas fa-plus m-1"></i><i class="fas fa-images"></i></a>
                <a href ="/item" className="btn"><i class="fas fa-calendar-alt"></i><i class="fas fa-image"></i></a>
                
            </div>
        </div> 
    )
}

export default SideNav;
